import React from 'react';
import Slider from "react-slick";

export const PrevArrow = ({ onClick }) => {
    return (
        <div 
        className="prev-arrow"
        onClick={onClick}
        >
        </div>   
    );
}

export const NextArrow = ({ onClick }) => {
    return (
        <div 
        className="next-arrow"
        onClick={onClick}
        >
        <i class="fas fa-chevron-right"></i>
        </div>   
    );
}
